    MODIFIES SQL DATA
BEGIN
SELECT `calendar`.`date_to`, `calendar`.`date_from` INTO @dt, @df FROM `minerva`.`calendar` WHERE `calendar`.`id` = id;
SELECT DATE_ADD(newDateFrom, INTERVAL DATEDIFF(@dt,@df) DAY) INTO @ndt;
SELECT COUNT(*) INTO @isOk FROM `minerva`.`calendar` WHERE `calendar`.`id` != id AND `calendar`.`room_type` = newRoomType AND ((newDateFrom >= `calendar`.`date_from` AND newDateFrom < `calendar`.`date_to`) OR (@ndt > `calendar`.`date_from` AND newDateFrom < `calendar`.`date_to`));
IF @isOk = 0 THEN
UPDATE `minerva`.`calendar` SET `calendar`.`date_from` = newDateFrom, `calendar`.`date_to` = @ndt, `calendar`.`room_type` = newRoomType WHERE `calendar`.`id` = id;
SET outValue = 1;
ELSE
SET outValue = -1;
END IF;
END$$

