DROP PROCEDURE IF EXISTS `NAPIMENU_GET_CURRENT_DAY_MENU`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `NAPIMENU_GET_CURRENT_DAY_MENU`()
    READS SQL DATA
BEGIN
SELECT `napimenudays`.`aktual` INTO @a FROM `minerva`.`napimenudays` WHERE `napimenudays`.`id` = 2;
SELECT DAYNAME(CURDATE()) INTO @d;
IF @d = 'Monday' THEN
SET @cd = 'Hétfő';
ELSEIF @d = 'Tuesday' THEN
SET @cd = 'Kedd';
ELSEIF @d = 'Wednesday' THEN
SET @cd = 'Szerda';
ELSEIF @d = 'Thursday' THEN
SET @cd = 'Csütörtök';
ELSEIF @d = 'Friday' THEN
SET @cd = 'Péntek';
ELSEIF @d = 'Saturday'THEN
SET @cd = 'Szombat';
ELSE
SET @cd = 'Vasárnap';
END IF;
IF @a = 1 THEN
SELECT `napimenudays`.`days` INTO @days FROM `minerva`.`napimenudays` WHERE `napimenudays`.`id` = 2;
ELSE
SELECT `napimenudays`.`days2` INTO @days FROM `minerva`.`napimenudays` WHERE `napimenudays`.`id` = 2;
SET @cd = CONCAT(@cd,'2');
END IF;
IF LOCATE(@cd,@days) > 0 THEN
SELECT * FROM `minerva`.`napimenu` WHERE `napimenu`.`nap` = @cd;
END IF;
END$$

