SELECT * FROM `minerva`.`napimenu` WHERE INSTR(@d, `napimenu`.`nap`) > 0;
ELSE
SELECT `napimenudays`.`days2` INTO @d FROM `minerva`.`napimenudays`;
SELECT * FROM `minerva`.`napimenu` WHERE INSTR(@d, `napimenu`.`nap`) > 0 AND INSTR(`napimenu`.`nap`,'2');
END IF;
END$$

